function Announcement(props) {
    return (
        <div id="announcement">
            <h4>{props.state3.announcements[props.index][0]}</h4>
            <p>{props.state3.announcements[props.index][1]}</p>
            <p>{props.state3.announcements[props.index][2]}</p>
        </div>
    );
}

export default Announcement;
